        import oracle.odi.domain.model.OdiDataStore
        import oracle.odi.domain.mapping.exception.MappingException
        import oracle.odi.km.exception.OdiKMException

        public class LKM_SQL_to_Object_Storage extends LKM_File_to_Object_Storage {

                protected String sqlText;
                protected String tempDirectory;
                protected String workDirectory;
                protected String tempFile;
                protected String srcDriver;
                protected String srcUrl;
                protected String srcUser;
                protected String srcPass;
                protected String tgtFormat;
                protected String tgtFieldSep;
                protected String tgtRowSep;
                protected String dateFormat;
                protected String timeFormat;
                protected String charSet;
                protected String fetchSize;

                protected Binding mBinding = null;

                public void setBinding(Binding binding) {

                    super.setBinding(binding);
                    mBinding = binding;

                    def tempSchema = getOptionValue("TEMP_SCHEMA")
                    if (tempSchema == null || tempSchema == "") {
                       throw new OdiKMException( "TEMP_SCHEMA option cannot be empty.");
                    }

                    tempDirectory = '<%=odiRef.getObjectName("L", "", odiRef.getOption("TEMP_SCHEMA"), "D")%>';
                    binding.setVariable("tempDirectory", tempDirectory);

                    workDirectory = '<%=odiRef.getObjectName("L", "", odiRef.getOption("TEMP_SCHEMA"), "W")%>';
                    binding.setVariable("workDirectory", workDirectory);

		    String fieldSeparatorOption = getOptionValue("FIELD_SEPARATOR");

                    tgtFormat = "VARIABLE";

		    if (fieldSeparatorOption == null || fieldSeparatorOption.equals("")) {
		      tgtFieldSep = ",";
		    } else {
		      tgtFieldSep = fieldSeparatorOption;
		    }
                    tgtRowSep = "\r\n";
                    tempFile = "odi_" + '<%=odiRef.getSession("SESS_GUID")%>_<%=odiRef.getStep( "NNO" )%>' + "_${physicalNode.getName()}.txt"

                    MapPhysicalNode targetNode = getDownstreamNode();
                    if (!targetNode.isAPNode()) {
                      OdiDataStore dataStore = (OdiDataStore)targetNode.getLogicalComponent().getBoundObject();
                      if (dataStore != null) {
                        tempFile = dataStore.getResourceName();
			String fileStorageFormat = dataStore.getTableFormatType().getName();
                        def fileFileDescriptor = dataStore.getFileDescriptor();
                        if (fileStorageFormat.equals("FIXED")) {
                           tgtFormat = "FIXED";
                           tgtFieldSep = ""
                        } else {
                           tgtFormat = "VARIABLE";
                           tgtFieldSep = fileFileDescriptor.getFieldSeparator();
                        }
                        tgtRowSep = fileFileDescriptor.getRowSeparator();
                      }
                    }
                    binding.setVariable("tempFile", tempFile);

                    binding.setVariable("sourceSchema", tempSchema);
                    binding.setVariable("resourceList", [tempFile]);
                    binding.setVariable("tgtFormat", tgtFormat);
                    binding.setVariable("tgtFieldSep", tgtFieldSep);
                    binding.setVariable("tgtRowSep", tgtRowSep);

                    srcDriver = '<?=odiRef.getInfo("SRC_JAVA_DRIVER")?>';
                    binding.setVariable("srcDriver", srcDriver);

                    srcUrl = '<?=odiRef.getInfo("SRC_JAVA_URL")?>';
                    binding.setVariable("srcUrl", srcUrl);

                    srcUser = '<?=odiRef.getInfo("SRC_USER_NAME")?>';
                    binding.setVariable("srcUser", srcUser);

                    srcPass = '<?=odiRef.getInfo("SRC_ENCODED_PASS")?>';
                    binding.setVariable("srcPass", srcPass);

                    dateFormat = getOptionValue("DATE_FORMAT");
                    if (dateFormat == null) { dateFormat = ""; }
                    binding.setVariable("dateFormat", dateFormat);

                    timeFormat = getOptionValue("TIMESTAMP_FORMAT");
                    if (timeFormat == null) { timeFormat = ""; }
                    binding.setVariable("timeFormat", timeFormat);


                    charSet = getOptionValue("CHARSET_ENCODING");
                    binding.setVariable("charSet", charSet);

                    fetchSize = getOptionValue("FETCH_SIZE");
                    binding.setVariable("fetchSize", fetchSize);

                }

                AbstractSyntaxTree SELECT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {
                    return sqlQuery;
                }

                AbstractSyntaxTree INSERT (SqlQuery sqlQuery) throws AdapterException, MappingException, GenerationException {
                    def sourceNode = getSourceNode();
                    if (sqlQuery != null) {
                      SqlQuery newQuery = sqlQuery.clone();

                      def inputSelectList = sqlQuery.getSelectList();
                      def newSelectList = [];
                      def inputAliasList = sqlQuery.getAliasList();
                      def newAliasList = [];

                      def nodeAttributes = [];
                      physicalNode.getPhysicalColumns().each { nodeAttributes.add(it.getReferencedAttribute()) }

                      if (inputAliasList != null) {
                       for (i in [inputSelectList,inputAliasList].transpose()) {
                        if (nodeAttributes.contains(i[0].getRefAttributeWithPath().getAttribute())) {
                           newSelectList.add(i[0]);
                           newAliasList.add(i[1]);
                        }
                       }
                       newQuery.setAliasList(newAliasList);
                      } else {
                       for (i in inputSelectList) {
                        if (nodeAttributes.contains(i.getRefAttributeWithPath().getAttribute())) {
                           newSelectList.add(i);
                        }
                       }
                      }
                      newQuery.setSelectList(newSelectList);

                      sqlText = newQuery.getText(sourceNode.getTemplateUtils());
                      mBinding.setVariable("sqlText", sqlText);
                      return newQuery;
                    } else {
                      sqlText = "";
                      mBinding.setVariable("sqlText", sqlText);
                      return sqlQuery;
                    }
                }
            }
